// Import the required modules
const express = require('express');
const cors = require('cors');

// Create an Express application
const app = express();

// Enable CORS for all routes
app.use(cors());

// Define a route
app.get('/', (req, res) => {
  const requestPath = req.path;
  console.log('Path:', requestPath);

  if (requestPath.includes('json')) {
    return res.send('Default');
  }

  const { sa, fingerType } = req.query;
  console.log(sa, 'query here')
  console.log('QueryString:', sa);

  if (!sa) {
    return res.send({
    "code": "00",
    "msg": "Successful",
    "version": 1.9,
    "value2": '',
});
  } else if (sa === 'retrieveDeviceId') {
    return res.send({
    "deviceId": "HP-5DD1960D5P",
    "code": "00",
    "msg": "Successful",
    "version": 1.9
});
  } else if (sa === 'retrieveDeviceCoordinate') {
    return res.send({
    "latitude": 6.561196645899177,
    "longitude": 3.3844627355591412,
    "locationAccuracy": 108,
    "code": "00",
    "msg": "Successful",
    "version": 1.9
});
  }else if( sa.includes('RIGHT_THUMB')){
    return res.send({
      code: '00',
      value: '',
      value2: '',
      msg: "Successful",
      version: 1.9
    })
  }else if(sa.includes('LEFT_INDEX')){
      
  }
  else if(sa.includes('LEFT_THUMB')){
    return res.send({
      msg: "Successful",
      version: 1.9,
      code: '00',
      value: '',
      value2: ''
    })
  }else if(sa.includes('RIGHT_INDEX')){
    return res.send({
      msg: "Successful",
      version: 1.9,
      code: '00',
      value: '',
      value2: ''
    })
  }else if(sa.includes('RIGHT_INDEX')){
    return res.send({
      msg: "Successful",
      version: 1.9,
      code: '00',
      value: '',
      value2: ''
    })
    
  }
  else if(sa.includes('capturePrint') && fingerType.includes('LEFT_THUMB')){
    return res.send({
      msg: "Successful",
      version: 1.9,
      code: '00',
      value: '',
      value2: ''
    })
  }
  else if(sa.includes('capturePrint') && fingerType.includes('RIGHT_THUMB')){
    return res.send({
      code: '00',
      value: '',
      value2: '',
      msg: "Successful",
      version: 1.9
    })
  }else if(sa.includes('capturePrint') && fingerType.includes('SINGLE_FINGER')){
    return res.send({
      code: '00',
      value: '',
      value2: '',
      msg: "Successful",
      version: 1.9
    })
  }

  else if(sa.includes('capturePrint') && fingerType.includes('RIGHT_INDEX')){
    return res.send({
      code: '00',
      value: '',
      value2: '',
      msg: "Successful",
      version: 1.9
    })
  }





  else if(sa.includes('capturePrint') && fingerType.includes('LEFT_INDEX')){
    return res.send({
      code: '00',
      value: '',
      value2: '',
      msg: "Successful",
      version: 1.9
    })
  }
  const acceptEncodingHeaderList = req.get('accept-encoding');
  console.log('AcceptEncoding Header List:', acceptEncodingHeaderList);

  if (acceptEncodingHeaderList && acceptEncodingHeaderList.includes('gzip, deflate')) {
    return res.send({
    "code": "00",
    "msg": "Successful",
    "version": 1.9
});
  }

  const requestBody = req.body;
  console.log('Request body:', requestBody);

  if (requestBody && requestBody.includes('some data')) {
    return res.send('Response N');
  }

  // If no condition is matched, return a default response
  return res.send({
    "code": "00",
    "msg": "Successful",
    "version": 1.9,
    "value2": '',
});
});

// Start the server
const port = 14843; // You can use any available port number
app.listen(port, () => {
  console.log(`Server is running on http://localhost:${port}`);
});